import React, { Component } from "react";
import { Link } from "react-router-dom";

class Home extends Component {
  state = {};
  render() {
    return (
      <div
        className="container  d-flex justify-content-center"
        style={{ height: "600 px" }}
      >
        <div className="row">
          <div className="card m-2">
            <div className="card-body">
              <Link className="nav-item nav-link text-center" to="/searchRide">
                Need a Ride
              </Link>
            </div>
          </div>
          <div className="card m-2">
            <div className="card-body">
              <Link className="nav-item nav-link text-center" to="/offerRide">
                Offer a Ride
              </Link>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
